window.bookSummaryJSON = "<p>No one said being bound to three dire wolf shifters and a possessive malevolent spirit was going to be easy.</p> <p>Fighting all the emotions that come with the connections is even harder.</p> <p>Thank goodness for my spot on the Elites team. Setting my focus on honing my powers and building my stamina by running with the wolves takes my mind off the fact that there are three original vampires out there somewhere, gagging for a taste of my blood.</p> <p>I can't worry about them right now.</p> <p>The Order is stepping out of the shadows and the Varga are upping their attacks. When the female shifters go missing, suspicion falls On the Varga. But I'm about to find out that nothing is what it seems, and the danger we're aware of could be nothing more than the tip of the iceberg.</p> <p>Contains mature themes.</p>"; 
